import logoblanc from "../../assets/logoBlanc.png";
import "../../styles/Layout.css";

function Footer() {
  return (
    <footer className="Home-header">
      <img src={logoblanc} className="Home-logoblanc" alt="logo" />

    </footer>
  );
}

export default Footer;
